// GamePage.js

import React from 'react';
import Card from './Card';

import Draggable from './Draggable';


const GamePage = () => {
    return (
        <div>
            <Card text="Métier 1" />
            <Card text="Métier 2" />
            <Draggable>

            <div>
                <p>PILE DE CARTE</p>
                </div>
                </Draggable>

        </div>
    );
};

export default GamePage;
